  "instructions": "<p>This is a wonderful profit hunt, reasonable for xp, and best of all, it's an alternative hunt.</p>\n<p>Recommended level is 300+, luring and closing the box. It is an excellent place to make bestiary, due to the variety of monsters.</p>\n<p></p>\n<p>üí∞ It's close to the depot, so loot all the gold you can and when the cap runs out, deposit the gold and go back to hunt.</p>\n<p></p>\n<p>Everything that is dropped on the spot you can sell in Rathleton, so take advantage of it and sell it all at once to return with maximum cap.</p>\n<p></p>\n<p>To come on this hunt, you need to have 500 Oramond points.</p>\n<p></p>\n<p>üõ°Ô∏è<strong> Equipments</strong></p>\n<p>The attack element to be used in this hunt is ENERGY, but you can use PHYSICAL as well.</p>\n<p></p>\n<p>If you need to protect yourself better, invest in items with earth protection, like TERRA HELMET, as earth is the most damage done after physical.</p>\n<p></p>\n<p>‚öîÔ∏è<strong> Strategy</strong></p>\n<p>The way back here is very simple, just go killing the monsters in the upper hallway and then in the lower hallway.</p>\n<p></p>\n<p>Some monsters attack from a distance, so you have to always keep using EXETA AMP RES to bring them close and finish.</p>\n<p></p>\n<p>Always leave LOST BERSERKER last as he is the toughest and the other creatures take your mana.</p>",
